window.bookSummaryJSON = "<p>Fate made a mistake that we may never recover from.<br> <br> For 17 years, I was the outcast of the Northwest Territory— the only wolf shifter who couldn’t shift or connect with the pack.<br> <br> Seen as worthless and weak.<br> <br> Leaving was my only escape.<br> <br> But everything changed the day I met Bodey, my sexy fated mate.<br> <br> With him by my side, magic surges through my veins, making me stronger than anyone.<br> <br> When marked queen, I wasn't ready for the throne...or the enemies brought with it.<br> <br> To protect my new pack, I must become a force that no one expects from me.<br> <br> Failure isn't an option; defeat means death.<br> <br> For Bodey and my pack, I'll challenge Fate herself.</p> <p>Dive into this pulse-pounding tale of power, passion, and peril—a romance story of fated mates, brooding alpha males, and royal wolf shifters that will leave you breathless.</p>"; 
